

var TEXTURE_LIBRARY = {};
TEXTURE_LIBRARY["rock"] = "data:image/jpeg;base64,";
TEXTURE_LIBRARY["noise"] = "data:image/gif;base64,";
TEXTURE_LIBRARY["noise2"] = "data:image/jpg;base64,";
//TEXTURE_LIBRARY["noise3"] = "data:image/png;base64,";
TEXTURE_LIBRARY["noise3"] = "data:image/jpg;base64,";
TEXTURE_LIBRARY["lensFlare"] = "data:image/jpg;base64,";
//TEXTURE_LIBRARY["lensFlare"] = "data:image/jpg;base64,";



var TextureGL = Base.extend({
	
	texture : null,
	
	constructor : function(gl, id)
	{
		var img = new Image();
		img.src = TEXTURE_LIBRARY[id];
		
		this.texture = gl.createTexture();
		gl.bindTexture(gl.TEXTURE_2D, this.texture);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.REPEAT);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.REPEAT);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.NEAREST);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.NEAREST);
		gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, img);		
	},

	get	: function()
	{
		return this.texture;		
	}
});

